$(".date").datetimepicker({icons:{time:"fa fa-clock-o",date:"fa fa-calendar",up:"fa fa-arrow-up",down:"fa fa-arrow-down"}}).each(function(){var n=$(this),t=n.parent();t.find(".datetimepicker-reset").on("click",function(){n.val("");n.datetimepicker("update")});t.find(".datetimepicker-show").on("click",function(){n.datetimepicker("show")})});
